static inline struct diglim_kern *
diglim_kern__open_and_load(void)
{
	struct diglim_kern *skel;

	skel = diglim_kern__open();
	if (!skel)
		return NULL;
	if (diglim_kern__load(skel)) {
		diglim_kern__destroy(skel);
		return NULL;
	}
	return skel;
}

